import React from "react";

function Jumbotron({ children }) {
  return (
    <div className="container-fluid">
    <div
      style={{ height: 120, clear: "both", paddingTop: 20, textAlign: "center" }}
    >
      {children}
    </div>
    </div>
  );
}

export default Jumbotron;
